function compress(){var a=$("#compressed");$.get({url:"/compress",dataType:"json",data:{url:$("#url").val()}}).success(function(b){$("#result").removeClass("hidden");a.val(b.result);if(b.success==true){a.removeClass("alert-danger").addClass("alert-success")}else{a.removeClass("alert-success").addClass("alert-danger")}})}$(function(){$("#start").on("click",compress)});